Дорогі харків’яни!
Робота депутата – вирішувати проблеми міста та конкретних виборців.
Я йду в депутати з конкретною програмою. Ця програма побудована на зверненнях мешканців району Нова Баварія – ваших пропозиціях та побажаннях.
Першочергові завдання:
- зупинити розкрадання коштів з міського бюджету та направити їх на відновлення Нової Баварії;
- відкрити для загального доступу інформацію про всі витрати з бюджету;
- компенсувати підвищення  комунальних тарифів;
- направити кошти на капітальний  ремонт доріг (пр. Ілліча, вул. Тімірязєва, вул. Кибальчича, 
вул. Луначарського, вул.  Ломоносова) та прилеглих вулиць;
- покращити транспортне сполучення, оновивши та розширивши автобусний парк;
 - збудувати дитячі та спортивні майданчики, відродити клуби спортивного дозвілля для молоді;
- створити асоціації власників жилих будинків для контролю за своєчасним ремонтом комунікацій, вивезенням сміття, освітленням вулиць та забудовою прибудинкових територій;
- правова допомога кожному;
Ваш кандидат у депутати в одномандатному мажоритарному виборчому окрузі №12 ЧУЙКО Іван.
